// src/components/Home.js
// home component 

import React from 'react';
import '../assets/styles/main.css';

function Home() {
    return (
        <div className="Home">
            <Header />
            <Main />
            <Projects />
            <AllProjects />
            <CoffeeChat />
            <Footer />
        </div>
    );
};

export default Home;
